import React from 'react';
import Carousello from './Carousel';
import Carta from './Carta'

function HomePage(){
    return(
        <div className="HomePage" background="./immagini/joker.png">
            <div>
                <Carousello/>
            </div>
            <br/>
            <div>
                    <Carta/>
            </div>
        </div>
    );
}

export default HomePage;
